            user: "SamsAI"
        }
    ])

    const handleSend = async (message) => {
        const newMessage = {
            message: message,
            user: "user",
        }
    }

    return (
        <div>
            <MainContainer>
                <ChatContainer>
                    <MessageList>
                        {messages.map((message, i) => {
                            return <Message key = {i} model = {message}/>
                        })}
                    </MessageList>
                </ChatContainer>
            </MainContainer>
        </div>
    );
}

export default Chat;
